import CountriesModel from "../models/domian/CountriesModel";

export default class AutocompleteControlViewModel {
  private countriesModel: CountriesModel;

  constructor(countries: CountriesModel) {
    this.countriesModel = countries;
  }

  public getSearchCountriesAsync(value: string) {
    this.countriesModel.addUser(value);
  }

  public get asyncLoading(): boolean {
    return this.countriesModel.asyncLoading;
  }
}
